import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-primary text-white p-4 flex justify-between">
      <h1 className="font-bold text-lg">Repair Management</h1>
      <div className="space-x-4">
        <button className="bg-secondary hover:bg-hoverBlue px-4 py-2 rounded">Dashboard</button>
        <button className="bg-accent hover:bg-accent px-4 py-2 rounded">Logout</button>
      </div>
    </nav>
  );
};

export default Navbar;
